Состав
ремешок (силикон 100%), линзы (поликарбонат 100%), фиксатор (поликарбонат 100%)

Характеристики:
- рекомендации по применению: снорклинг, пляжный отдых;
- количество стекол: моностекольная;
- вес, грамм: 125;
- возможность установки корректирующих линз (диоптрий): нет;
- покрытие стекла: нет;
- безрамочная технология: нет;
- крепление для GoPro: нет;
- материал иллюминатора: пластик;
- материал обтюратора: силикон;
- материал рамки: нет;
- доступные цвета: серый, синий, красный, аквамарин, черный, прозрачный;
- пол: унисекс;
- сумка для хранения: да;
- страна бренда: Италия;
- страна производства: Китай.

- уменьшенный размер, подходящий для детского лица;
- маленький подмасочный объем+широкий обзор;
- закаленное стекло;
- гипоаллергенный силикон;
- удобные застежки;
- удобный широкий ремешок;
- пластиковый бокс в комплекте.

